    local index = eurex_cash_eti_t7_v10_1.request_header_comp.fields(buffer, offset, packet, parent)
    local length = index - offset
    parent:set_len(length)
    local display = eurex_cash_eti_t7_v10_1.request_header_comp.display(packet, parent, length)
    parent:append_text(display)

    return index, parent
